<!doctype html>
<html lang="en">
<head>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <title>Species Plot</title>
        <link rel="preconnect" href="https://fonts.googleapis.com" />
        <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin />
        <link href="https://fonts.googleapis.com/css2?family=Nunito+Sans:wght@400;700&family=Poppins:wght@300;400;600;700&display=swap" rel="stylesheet" />
    <script src="https://cdn.plot.ly/plotly-2.30.0.min.js"></script>
    <style>
                :root {
                    --header-bg: #0c1b50;
                    --accent-teal: #009688;
                    --accent-magenta: #dc337d;
                    --accent-green: #748938;
                    --accent-slate: #4b6576;
                    --text: #454545;
                    --border: #ccc;
                    --panel: #fff;
                    --panel-muted: #f7f7f7;
                }

                body { font-family: 'Poppins', system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif; margin: 0; color: var(--text); background: #fff; }
                .topbar { position: sticky; top: 0; background: var(--header-bg); z-index: 20; }
        .titlebar { padding: 10px 12px 6px 12px; }
                .pagetitle { font-family: 'Nunito Sans', system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif; font-size: 48px; font-weight: 800; line-height: 1.1; color: #fff; }
                .rule { border-top: 1px solid rgba(255,255,255,0.18); }
        .controls { display: flex; align-items: center; justify-content: space-between; gap: 12px; padding: 10px 12px; }
        .tabs { display: flex; gap: 8px; }
                .tabbtn { border: 1px solid rgba(255,255,255,0.25); background: rgba(255,255,255,0.06); color: #fff; padding: 8px 12px; cursor: pointer; border-radius: 6px; font-weight: 600; }
                .tabbtn.active { border-color: rgba(0,150,136,0.95); color: #fff; background: rgba(0,150,136,0.22); }
        .speciesctl { display: flex; align-items: center; gap: 8px; }
                .speciesctl label { font-weight: 700; color: #fff; }
                .speciesctl select { padding: 8px 10px; border-radius: 6px; border: 1px solid rgba(255,255,255,0.25); background: rgba(255,255,255,0.95); }
        .pane { display: none; padding: 12px; }
        .pane.active { display: block; }
        /* Plot pane uses flex so controls below plot stay visible */
        #plot.pane.active {
            display: flex;
            flex-direction: column;
            height: calc(100vh - 154px);
            box-sizing: border-box;
        }
        /* Plot page layout: centered, 80% width */
        .plotwrap {
            width: 80%;
            margin: 0 auto;
            flex: 1 1 auto;
            min-height: 320px;
            height: auto;
          }
          #mainPlot { width: 100%; height: 100%; }
        .notablewrap { width: 60%; margin: 0 auto; }
        .lifersheader { font-family: 'Nunito Sans', system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif; font-size: 32px; font-weight: 800; margin: 8px 0 10px 0; color: var(--header-bg); }
        table { border-collapse: collapse; width: 100%; }
        th, td { border: 1px solid #ddd; padding: 6px 8px; }
        th { background: var(--panel-muted); text-align: left; color: var(--header-bg); }
        /* Owls page layout: centered, 60% width, 8 plots fill viewport height */
        .owlwrap {
            width: 60%;
            margin: 0 auto;
            height: calc(100vh - 130px);
            display: flex;
            flex-direction: column;
            gap: 6px;
        }
        .owlplot {
            flex: 1 1 0;
            min-height: 120px;
        }
        /* Ensure plotly div fills the flex cell */
        .owlplot > div { height: 100% !important; width: 100% !important; }

        /* Watchlist page layout: same as Owls */
        .watchwrap {
            width: 60%;
            margin: 0 auto;
            height: calc(100vh - 130px);
            display: flex;
            flex-direction: column;
            gap: 6px;
        }
        .watchplot {
            flex: 1 1 0;
            min-height: 90px;
        }
        .watchplot > div { height: 100% !important; width: 100% !important; }

        /* Trendline UI below main plot */
        .trendwrap { width: 80%; margin: 10px auto 0 auto; flex: 0 0 auto; }
        .trendctl { display: flex; align-items: center; gap: 8px; font-weight: 600; }
        .trendstats {
            margin-top: 8px;
            padding: 10px 12px;
            border: 1px solid var(--border);
            border-radius: 6px;
            background: var(--panel-muted);
            font-family: ui-monospace, SFMono-Regular, Menlo, Monaco, Consolas, "Liberation Mono", "Courier New", monospace;
            white-space: pre-wrap;
            display: none;
        }
    </style>
</head>

        <div class="titlebar">
            <div id="pageTitle" class="pagetitle">Wrentit</div>
        <div class="rule"></div>
        <div class="controls">
            <div class="tabs">
                <button class="tabbtn active" data-tab="plot">Plot</button>

                <button class="tabbtn" data-tab="owls_rare">Owls - rare</button>
                <button class="tabbtn" data-tab="notable">Notable</button>
                <button class="tabbtn" data-tab="watch_fire">Watchlist - fire</button>
                <button class="tabbtn" data-tab="watch_climate">Watchlist - climate change</button>
                <button class="tabbtn" data-tab="watch_landuse">Watchlist - land use change</button>
            </div>
            <div id="speciesControls" class="speciesctl">

                <select id="speciesSelect"></select>
                  <label for="trendingSelect">Trending</label>
                  <select id="trendingSelect"></select>
            </div>
        </div>
    </div>

                Show trendline (significant trends only)
            </label>
            <div id="trendStats" class="trendstats" aria-live="polite"></div>
        </div>
    </div>

            for (let i = 0; i < firstNonZero; i++) {

            let ssTot = 0, ssRes = 0;
            for (let i = 0; i < n; i++) {
                const yHat = intercept + slope * x[i];
                ssTot += (y[i] - meanY) * (y[i] - meanY);
                ssRes += (y[i] - yHat) * (y[i] - yHat);
            }
            const r2 = ssTot === 0 ? 0 : 1 - (ssRes / ssTot);
            return { n, slope, intercept, r2 };
        }

        function getSpeciesSeries(i, vis) {
            if (!Array.isArray(vis)) return null;

            const visibleIdxs = [];
            for (let t = 0; t < vis.length; t++) if (vis[t]) visibleIdxs.push(t);

            const isMarkers = (trace) => {
                const mode = String(trace?.mode || '');
                return mode.includes('markers') && Array.isArray(trace?.x) && Array.isArray(trace?.y);
            };

            const isRed = (trace) => {
                const c = trace?.marker?.color;
                return c === 'red';
            };

            let mainMarkers = null;
            let redMarkers = null;
            for (const idx of visibleIdxs) {
                const tr = PLOT_DATA[idx];
                if (!isMarkers(tr)) continue;
                if (isRed(tr)) redMarkers = tr;
                else if (!mainMarkers && tr.x.length > 1) mainMarkers = tr;
            }

            if (!mainMarkers) return null;

            const years = [];
            const counts = [];
            for (let k = 0; k < mainMarkers.x.length; k++) {
                const yrRaw = mainMarkers.x[k];
                const ctRaw = mainMarkers.y[k];
                // Treat null/undefined as missing data (do not coerce to 0)
                if (yrRaw === null || yrRaw === undefined || ctRaw === null || ctRaw === undefined) continue;
                const yr = Number(yrRaw);
                const ct = Number(ctRaw);
                if (Number.isFinite(yr) && Number.isFinite(ct)) {
                    years.push(yr);
                    counts.push(ct);
                }
            }

            if (redMarkers && Array.isArray(redMarkers.x) && redMarkers.x.length === 1) {
                const yrRaw = redMarkers.x[0];
                const ctRaw = redMarkers.y?.[0];
                // Treat null/undefined as missing data (do not coerce to 0)
                if (yrRaw !== null && yrRaw !== undefined && ctRaw !== null && ctRaw !== undefined) {
                    const yr = Number(yrRaw);
                    const ct = Number(ctRaw);
                    if (Number.isFinite(yr) && Number.isFinite(ct)) {
                        years.push(yr);
                        counts.push(ct);
                    }
                }
            }

            const pairs = years.map((yr, idx) => [yr, counts[idx]]).sort((a, b) => a[0] - b[0]);
            return {
                years: pairs.map(p => p[0]),
                counts: pairs.map(p => p[1]),
            };
        }

        function formatTrendStatsBlock(label, speciesName, series, mk, lr, note, pctPerDecade, isStrong) {
            const nonZero = series.counts.reduce((acc, v) => acc + (v > 0 ? 1 : 0), 0);
            const direction = lr.slope > 0 ? 'increasing' : (lr.slope < 0 ? 'decreasing' : 'flat');
            const pStr = mk.p < 0.001 ? '<0.001' : mk.p.toFixed(3);
            const lines = [
                `${label}:`,
                `Years used: ${series.years.length} (${series.years[0]}${series.years[series.years.length - 1]}), non-zero years: ${nonZero}`,
                `MannKendall: z=${mk.z.toFixed(3)}, p=${pStr}`,
                `Regression: slope=${lr.slope.toExponential(3)} per year, R=${lr.r2.toFixed(3)} (${direction})`,
                `Effect (model implied): ${pctPerDecade.toFixed(1)}% per decade in (1+count)${isStrong ? ' [STRONG]' : ''}`,
            ];
            if (note) lines.push(note);
            return lines.join('\n');
        }

        function analyzeTrend(speciesName, series, label) {
            const trimmedRes = trimLeadingZerosForTrend(series);
            const s = trimmedRes.series;
            const trimmed = trimmedRes.trimmed;

            const nonZero = s.counts.reduce((acc, v) => acc + (v > 0 ? 1 : 0), 0);
            if (s.years.length < TREND_MIN_YEARS || nonZero < TREND_MIN_NONZERO) {
                return {
                    label,
                    ok: false,
                    significant: false,
                    series: s,
                    pctPerDecade: 0,
                    strong: false,
                    message: [
                        `${label}:`,
                        `Not enough data to evaluate trend reliably.`,
                        `Years used: ${s.years.length} (${s.years[0]}${s.years[s.years.length - 1]}), non-zero years: ${nonZero}`,
                        ...(trimmed ? [`Note: trimmed ${trimmed} leading zero-year(s) (treated as missing) before first non-zero.`] : []),
                        `Thresholds: years>=${TREND_MIN_YEARS}, non-zero>=${TREND_MIN_NONZERO}`,
                    ].join('\n'),
                };
            }

            const yLog = s.counts.map(c => Math.log1p(c));
            const lr = linearRegression(s.years, yLog);
            const mk = mannKendall(yLog);
            const significant = (mk.p < 0.05) && (lr.r2 >= TREND_MIN_R2);
            const pctPerDecade = pctChangePerDecadeFromSlope(lr.slope);
            const strong = significant && (Math.abs(pctPerDecade) >= TREND_STRONG_PCT_PER_DECADE);

            let note = '';
            if (trimmed) {
                note = `Trimmed ${trimmed} leading zero-year(s) (treated as missing) before first non-zero.`;
            }
            if (!significant) {
                if (!(mk.p < 0.05)) {
                    note = (note ? note + ' ' : '') + `No significant trend at p<0.05.`;
                } else if (!(lr.r2 >= TREND_MIN_R2)) {
                    note = (note ? note + ' ' : '') + `Trend filtered out due to low R (<${TREND_MIN_R2.toFixed(2)}).`;
                }
            }

            return {
                label,
                ok: true,
                significant,
                series: s,
                lr,
                mk,
                pctPerDecade,
                strong,
                message: formatTrendStatsBlock(label, speciesName, s, mk, lr, note, pctPerDecade, strong),
            };
        }

        function updateTrendTrace(traceIndex, analysis, speciesName, nameSuffix, style) {
            if (!Number.isFinite(traceIndex)) return;
            if (!analysis || !analysis.ok || !analysis.significant) {
                window.Plotly.restyle('mainPlot', { visible: false }, [traceIndex]);
                return;
            }

            const minYear = Math.min(...analysis.series.years);
            const maxYear = Math.max(...analysis.series.years);
            const xFit = [];
            const yFit = [];
            for (let yr = minYear; yr <= maxYear; yr++) {
                xFit.push(yr);
                yFit.push(Math.max(0, Math.expm1(analysis.lr.intercept + analysis.lr.slope * yr)));
            }

            window.Plotly.restyle(
                'mainPlot',
                {
                    x: [xFit],
                    y: [yFit],
                    name: [`Trendline ${nameSuffix} (${speciesName})`],
                    visible: [true],
                    'line.color': [style?.color],
                    'line.width': [style?.width],
                    'line.dash': [style?.dash],
                },
                [traceIndex]
            );
        }

        let trendingMetaByIndex = new Map();

        function computeTrendingIndices() {
            const trending = [];
            trendingMetaByIndex = new Map();
            for (let i = 0; i < SPECIES.length; i++) {
                const vis = VIS_BY_SPECIES[i];
                const speciesName = SPECIES[i];
                if (!vis || !speciesName) continue;
                const series = getSpeciesSeries(i, vis);
                if (!series) continue;
                const full = analyzeTrend(speciesName, series, 'Full series');
                const recentSeries = sliceRecentWindow(series, TREND_RECENT_WINDOW_YEARS);
                const recent = recentSeries
                    ? analyzeTrend(speciesName, recentSeries, `Past ${TREND_RECENT_WINDOW_YEARS} years`)
                    : null;

                const candidates = [];
                if (full.ok && full.significant) candidates.push(full);
                if (recent && recent.ok && recent.significant) candidates.push(recent);
                if (!candidates.length) continue;

                // Choose the most pronounced (by absolute effect size) among significant fits.
                let best = candidates[0];
                for (let j = 1; j < candidates.length; j++) {
                    const cur = candidates[j];
                    if (Math.abs(cur.pctPerDecade) > Math.abs(best.pctPerDecade)) best = cur;
                }

                trendingMetaByIndex.set(i, {
                    label: best.label,
                    pctPerDecade: best.pctPerDecade,
                    strong: !!best.strong,
                });
                trending.push(i);
            }

            trending.sort((a, b) => {
                const ma = trendingMetaByIndex.get(a);
                const mb = trendingMetaByIndex.get(b);
                const da = ma ? Math.abs(ma.pctPerDecade) : 0;
                const db = mb ? Math.abs(mb.pctPerDecade) : 0;
                return db - da;
            });
            return trending;
        }

        function updateTrendline(i, vis, speciesName) {
            if (!toggleTrendline || !trendStatsEl) return;

            const wants = !!toggleTrendline.checked;
            if (!wants) {
                trendStatsEl.style.display = 'none';
                if (trendTraceFullIndex !== null) window.Plotly.restyle('mainPlot', { visible: false }, [trendTraceFullIndex]);
                if (trendTraceRecentIndex !== null) window.Plotly.restyle('mainPlot', { visible: false }, [trendTraceRecentIndex]);
                return;
            }

            trendStatsEl.style.display = 'block';
            const series = getSpeciesSeries(i, vis);
            if (!series) {
                trendStatsEl.textContent = `Trend stats\nSpecies: ${speciesName}\nNo time series found.`;
                if (trendTraceFullIndex !== null) window.Plotly.restyle('mainPlot', { visible: false }, [trendTraceFullIndex]);
                if (trendTraceRecentIndex !== null) window.Plotly.restyle('mainPlot', { visible: false }, [trendTraceRecentIndex]);
                return;
            }

            const full = analyzeTrend(speciesName, series, 'Full series');
            const recentSeries = sliceRecentWindow(series, TREND_RECENT_WINDOW_YEARS);
            const recent = recentSeries
                ? analyzeTrend(speciesName, recentSeries, `Past ${TREND_RECENT_WINDOW_YEARS} years`)
                : {
                    label: `Past ${TREND_RECENT_WINDOW_YEARS} years`,
                    ok: false,
                    significant: false,
                    series: { years: [], counts: [] },
                    message: `Past ${TREND_RECENT_WINDOW_YEARS} years:\nNo data available in window.`,
                };

            trendStatsEl.textContent = [
                `Trend stats (log1p(count) ~ year)`,
                `Species: ${speciesName}`,
                '',
                full.message,
                '',
                recent.message,
                '',
                `Displayed: full=${full.ok && full.significant && Number.isFinite(trendTraceFullIndex) ? 'yes' : 'no'}, recent=${recent.ok && recent.significant && Number.isFinite(trendTraceRecentIndex) ? 'yes' : 'no'}`,
                `Thresholds: years>=${TREND_MIN_YEARS}, non-zero>=${TREND_MIN_NONZERO}, p<0.05, R>=${TREND_MIN_R2.toFixed(2)}, strong if |%/dec|>=${TREND_STRONG_PCT_PER_DECADE}`,
            ].join('\n');

            updateTrendTrace(
                trendTraceFullIndex,
                full,
                speciesName,
                '(full)',
                                { color: '#9467bd', width: 2, dash: 'dash' }
            );
            updateTrendTrace(
                trendTraceRecentIndex,
                recent,
                speciesName,
                `(past ${TREND_RECENT_WINDOW_YEARS}y)`,
                                { color: '#ff7f0e', width: 2, dash: 'dash' }
            );
        }

        function resizeMainPlot() {
            if (!window.Plotly) return;
            const el = document.getElementById('mainPlot');
            if (el) {
                try { window.Plotly.Plots.resize(el); } catch (e) {}
            }
        }

        function resizeWatchPlots(tabId) {
            if (!window.Plotly) return;
            const root = document.getElementById(tabId);
            if (!root) return;
            root.querySelectorAll('.js-plotly-plot').forEach(el => {
                try { window.Plotly.Plots.resize(el); } catch (e) {}
            });
        }

        function setTitle(text) {
            titleEl.textContent = text;
        }

        function setSpecies(index) {
            const i = Number(index) || 0;
            const vis = VIS_BY_SPECIES[i];
            const yRange = YRANGE_BY_SPECIES[i];
            const speciesName = SPECIES[i];
            if (!vis || !yRange || !speciesName) return;

            currentSpeciesIndex = i;

            // Only apply visibility to the original traces (we add a trendline trace dynamically).
            window.Plotly.restyle('mainPlot', { visible: vis }, BASE_TRACE_INDICES);
            window.Plotly.relayout('mainPlot', { 'yaxis.range': yRange });
            setTitle(speciesName);

            if (speciesSelect) speciesSelect.value = String(i);
            if (trendingSelect) trendingSelect.value = trendingIndexSet.has(i) ? String(i) : '';

            updateTrendline(i, vis, speciesName);
        }

        function initSpeciesSelect() {
            SPECIES_LABELS.forEach((label, idx) => {
                const opt = document.createElement('option');
                opt.value = String(idx);
                opt.textContent = label;
                speciesSelect.appendChild(opt);
            });
            speciesSelect.value = String(DEFAULT_INDEX);
            speciesSelect.addEventListener('change', (e) => {
                setSpecies(e.target.value);
            });
        }

        function initTrendingSelect() {
            if (!trendingSelect) return;

            const trending = computeTrendingIndices();
            trendingIndexSet = new Set(trending);

            // Clear any existing options
            trendingSelect.innerHTML = '';

            const placeholder = document.createElement('option');
            placeholder.value = '';
            placeholder.textContent = `Trending (${trending.length})`;
            trendingSelect.appendChild(placeholder);

            for (const idx of trending) {
                const opt = document.createElement('option');
                opt.value = String(idx);
                const meta = trendingMetaByIndex.get(idx);
                const pct = meta?.pctPerDecade ?? 0;
                const arrow = pct > 0 ? '' : (pct < 0 ? '' : '');
                const strongTag = (meta?.strong) ? 'STRONG ' : '';
                const baseLabel = SPECIES_LABELS[idx] || SPECIES[idx] || String(idx);
                opt.textContent = `${strongTag}${arrow} ${pct.toFixed(0)}%/dec  ${baseLabel}`;
                trendingSelect.appendChild(opt);
            }

            trendingSelect.addEventListener('change', (e) => {
                const v = String(e.target.value || '');
                if (!v) return;
                setSpecies(v);
            });

            // Sync initial state
            const i = Number(currentSpeciesIndex) || 0;
            trendingSelect.value = trendingIndexSet.has(i) ? String(i) : '';
        }

        function initMainPlot() {
            const config = { displayModeBar: true, responsive: true };
            const trendTraceFull = {
                x: [],
                y: [],
                type: 'scatter',
                mode: 'lines',
                hoverinfo: 'skip',
                showlegend: false,
                visible: false,
                line: { color: '#9467bd', width: 2, dash: 'dash' },
            };

            const trendTraceRecent = {
                x: [],
                y: [],
                type: 'scatter',
                mode: 'lines',
                hoverinfo: 'skip',
                showlegend: false,
                visible: false,
                line: { color: '#ff7f0e', width: 2, dash: 'dash' },
            };

            window.Plotly.newPlot('mainPlot', PLOT_DATA, PLOT_LAYOUT, config).then(() => {
                return window.Plotly.addTraces('mainPlot', [trendTraceFull, trendTraceRecent]).then((newIdxs) => {
                    // Plotly's addTraces return value varies by version; rely on deterministic indices.
                    // We always append exactly two traces after the base PLOT_DATA.
                    trendTraceFullIndex = BASE_TRACE_COUNT;
                    trendTraceRecentIndex = BASE_TRACE_COUNT + 1;
                    if (toggleTrendline) {
                        // Default: trendline enabled on load
                        toggleTrendline.checked = true;
                        toggleTrendline.addEventListener('change', () => {
                            const i = Number(currentSpeciesIndex) || 0;
                            const vis = VIS_BY_SPECIES[i];
                            const speciesName = SPECIES[i] || '';
                            updateTrendline(i, vis, speciesName);
                        });
                    }
                    initSpeciesSelect();
                    initTrendingSelect();
                    setSpecies(DEFAULT_INDEX);
                });
            });
        }

        buttons.forEach(btn => {
            btn.addEventListener('click', () => {
                buttons.forEach(b => b.classList.remove('active'));
                panes.forEach(p => p.classList.remove('active'));
                btn.classList.add('active');
                document.getElementById(btn.dataset.tab).classList.add('active');
                if (btn.dataset.tab === 'owls_common') {
                    setTimeout(() => resizeWatchPlots('owls_common'), 0);
                    speciesControls.style.display = 'none';
                    setTitle('Owls - common');
                }
                if (btn.dataset.tab === 'owls_rare') {
                    setTimeout(() => resizeWatchPlots('owls_rare'), 0);
                    speciesControls.style.display = 'none';
                    setTitle('Owls - rare');
                }
                if (btn.dataset.tab === 'watch_fire') {
                    setTimeout(() => resizeWatchPlots('watch_fire'), 0);
                    speciesControls.style.display = 'none';
                    setTitle('Watchlist - fire');
                }
                if (btn.dataset.tab === 'watch_climate') {
                    setTimeout(() => resizeWatchPlots('watch_climate'), 0);
                    speciesControls.style.display = 'none';
                    setTitle('Watchlist - climate change');
                }
                if (btn.dataset.tab === 'watch_landuse') {
                    setTimeout(() => resizeWatchPlots('watch_landuse'), 0);
                    speciesControls.style.display = 'none';
                    setTitle('Watchlist - land use change');
                }
                if (btn.dataset.tab === 'plot') {
                    setTimeout(resizeMainPlot, 0);
                    speciesControls.style.display = 'flex';
                    // Restore to currently selected species.
                    setTitle(SPECIES[Number(speciesSelect.value) || 0] || 'Wrentit');
                }
                if (btn.dataset.tab === 'notable') {
                    speciesControls.style.display = 'none';
                    setTitle('Notable');
                }
            });
        });

        window.addEventListener('resize', () => {
            const owlsCommon = document.getElementById('owls_common');
            const owlsRare = document.getElementById('owls_rare');
            if (owlsCommon && owlsCommon.classList.contains('active')) {
                resizeWatchPlots('owls_common');
            }
            if (owlsRare && owlsRare.classList.contains('active')) {
                resizeWatchPlots('owls_rare');
            }
            const wf = document.getElementById('watch_fire');
            if (wf && wf.classList.contains('active')) resizeWatchPlots('watch_fire');
            const wc = document.getElementById('watch_climate');
            if (wc && wc.classList.contains('active')) resizeWatchPlots('watch_climate');
            const wl = document.getElementById('watch_landuse');
            if (wl && wl.classList.contains('active')) resizeWatchPlots('watch_landuse');
            const plotPane = document.getElementById('plot');
            if (plotPane && plotPane.classList.contains('active')) {
                resizeMainPlot();
            }
        });

        // Initial load
        initMainPlot();
    </script>
</body>
</html>
